import React, { useState } from "react";
import { Link } from "react-router-dom";
import '../css/nav.css'

function Navbar(){
  return(
    <nav className="nav">
      <Link><img src="./Recrash.png" className="recr"/></Link>
      <div className="texts">
        <Link>
          <h1>Home</h1>
        </Link>
        <Link>
          <h1>Map</h1>
        </Link>
        <Link>
          <h1>About</h1>
        </Link>
      </div>
    </nav>
  )
}
export default Navbar;
